Dan Duzi Od Godine (1971) Domaci Film


Rezija: Branimir Tori Jankovic

Uloge: Adem Cejvan, Boro Begovic, Dragomir Gidra Bojanic, Ljuba Tadic, Pavle Vujisic, Dragoljub Gula Milosavljevic, Branislav Ciga Milenkovic, Zdravko Biogradlija, Vasa Pantelic, Zaim Muzaferija, Davor Antolic, Milan Veljkovic, Pero Mojas, Milos Kandic, Slavko Zamola...

Radnja filma se zasniva na prikazivanju drame zemljotresa u Banjaluci 1969. kroz licne i kolektivne sudbine robijasa koji su se u to vrijeme zatekli u banjaluckom zatvoru...

